import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import PlayerPicksPage from './components/PlayerPicksPage';
import PrintablePage from './components/PrintablePage';
import ResultsPage from './components/ResultsPage';
import AdminUploadPage from './components/AdminUploadPage'; // ✅ Make sure this path is correct
import AdminPicksPage from './components/AdminPicksPage';   // Optional, include if using
import HomePage from './components/HomePage';               // Optional, if you have a home

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/picks/week/:weekNumber" element={<PlayerPicksPage />} />
        <Route path="/print/week/:weekNumber" element={<PrintablePage />} />
        <Route path="/results" element={<ResultsPage />} />
        <Route path="/admin-upload" element={<AdminUploadPage />} /> {/* ✅ This is the missing route */}
        <Route path="/admin-picks" element={<AdminPicksPage />} />   {/* Optional */}
      </Routes>
    </Router>
  );
}

export default App;
